INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 7, 5118061, 2834, "フリーマーケット会場", 20063115, "ペコリーヌとの出会い", "青空の下で謁見", 0, 1, 2, 10118, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 7, 5118062, 2835, "フリーマーケット会場", 20063115, "マホとの出会い", "未来の騎空団\nマスコット？", 0, 1, 2, 10118, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 7, 5118063, 2837, "ランドソル市街地", 20063115, "アキノとの出会い", "お嬢さまからの\n緊急依頼", 0, 1, 2, 10118, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118064, 4108402, "フリーマーケット会場", 20063115, "ジュンとの出会い", "黄金色の悩みごと", 0, 1, 2, 10118, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118065, 4107402, "フリーマーケット会場", 20063115, "カオリとの出会い", "白熱！　格闘大会！", 0, 1, 2, 10118, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 16, 5118066, 9000227, "オーエド町", 20063115, "ニノンとの出会い", "祭り太鼓はオーエドの華", 1, 1, 2, 10118, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 19, 5118067, 2101181, "フリーマーケット会場", 20063115, "スズナとの出会い", "人気者は遅れて\nやってくる", 0, 1, 3, 10118, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118068, 4109402, "ランドソル市街地", 20063115, "ナナカとの出会い", "巫女・ミーツ・魔法少女", 0, 1, 3, 10118, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118069, 4305402, "フリーマーケット会場", 20063115, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", 0, 1, 3, 10118, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118070, 4101402, "ランドソル市街地", 20063115, "ユカリとの出会い", "この出会いにカンパイ！", 0, 1, 3, 10118, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 18, 5118071, 4106402, "ランドソル市街地", 20063115, "アオイとの出会い", "陰陽アンサンブル", 0, 1, 3, 10118, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 7, 5118072, 2836, "フリーマーケット会場", 20063115, "シノブとの出会い", "運試し十番勝負！", 1, 1, 3, 10118, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 40);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (0, 0, 5118600, 0, 0, 20063115, "オープニング", "彼女たちの新たな日常", 0, 0, 1, 10118, 0, 0, 0);
